import React from 'react';
import './BeverageModule.css';
import {Grid} from '../../assets/UiKit/grid/Gird';
import {Line, Rows} from '../../assets/UiKit/Line/Line'; 
import bottlesShelf from '../../assets/images/bottlesMudle.jpg'
import bottleImg from '../.././data/images/Cocacola.png'

interface BeverageModuleProps {
  rowsCount: number;
  columnsCount: number;
  bottlesArray: {
    name: string;
    price: number;
    key: string;
  }[];
}

export default function BeverageModule(props: BeverageModuleProps) {
  const { bottlesArray } = props;

  return (
    <div className='beverageModuleContainer'>
    <img className='beverage_layout_background' src={bottlesShelf} alt={"store lay out"} />

      <Grid>
        <Line>
        <Rows>
      {bottlesArray.map((bottle, index) => {

        return (

          <div className='productDisplay' key={bottle.key}>
            <img className='bottlesImg' src={bottleImg} alt={bottle.name} />
            {/* <p>{bottle.name}</p> */}
            {/* <p>{bottle.price}</p> */}
          </div>

        );
      })}
      </Rows>
      </Line>
      </Grid>
    </div>
  );
}
